pragma solidity ^0.4.18;

contract SimpleStorage {
  uint storedData;

  struct PushData{
    bytes32 name;
    bytes32 flight;

  }
  mapping(bytes32 => PushData) public pushDatas;

  function StoreData(bytes32 key,bytes32 name, bytes32 flight) public returns (bool s){
    pushDatas[key].name = name;
    pushDatas[key].flight = flight;
    return true;
  }

  function set(uint x) public {
    storedData = x;
  }

  function get() public view returns (uint) {
    return storedData;
  }
}


contract Retrieve {

  SimpleStorage d;


  struct PushData{
    bytes32 name;
    bytes32 flight;

  }

  function Retrieve(address DContractAddress) {
    d = SimpleStorage(DContractAddress);
  }

  function RetrieveData(bytes32 key)
    public
    constant
    returns(bytes32, bytes32)
  {
    // Declare a temporary "doc" to hold a DocumentStruct
    PushData memory doc;
    // Get it from the "public" mapping's free getter.
    (doc.name, doc.flight) = d.pushDatas(key);
    // return values with a fixed sized layout
    return(doc.name, doc.flight);
  }
}
